try:
    print(f"Number of stabilizers: {len(stabilizers)}")
    print(f"Number of qubits: {len(stabilizers[0])}")
    
    # We have 136 qubits.
    # Check if we have 136 stabilizers.
    if len(stabilizers) == 136:
         tableau = stim.Tableau.from_stabilizers([stim.PauliString(s) for s in stabilizers])
         circuit = tableau.to_circuit()
    else:
         print(f"Warning: {len(stabilizers)} stabilizers for {len(stabilizers[0])} qubits.")
         tableau = stim.Tableau.from_stabilizers([stim.PauliString(s) for s in stabilizers], allow_underconstrained=True)
         circuit = tableau.to_circuit()

    if 'circuit' in locals():
        with open("solve_136_circuit.stim", "w") as f:
            f.write(str(circuit))
        print("Circuit generated successfully.")
    else:
        print("Circuit not generated.")

except Exception as e:
    print(f"Error: {e}")
